const fetchData = (allData, tableData) => {
  let data = {};
  for (let item in allData) {
    data[allData[item].label] = allData[item].value;
  }
  for (let item in tableData) {
    data.push(tableData[(item.label = tableData[item.value])]);
  }
  console.log(data);
};

module.exports = fetchData;
